            console.log(&#039;Has Errors&#039;);
        });

        var drDestroy = $(&#039;#input-file-to-destroy&#039;).dropify();
        drDestroy = drDestroy.data(&#039;dropify&#039;)
        $(&#039;#toggleDropify&#039;).on(&#039;click&#039;, function(e) {
